import React from 'react';
import Navbar from '../navbar/navbar';
import {Grid} from '@material-ui/core' ;


const App = () => {
  return (
    <Grid container direction = "column">
      <Grid item>
        This is where the header will be
      </Grid>
      <Grid item>This is where the content will be</Grid>
    </Grid>
  );
}

export default App;
